config.description:
An array of custom configuration objects. If set, it has priority over <code>tags</code>. Example: <pre>
[
    {
        "label": "My property 1",
        "type": "string",
        "path": "path/to/my/property1"
    },
    {
        "label": "My property 2",
        "type": "string",
        "path": "path/to/my/property2"
    }
]
</pre> Where: <ul> <li><b>label</b> = text string for the property editor label</li> <li><b>type</b> = one of the registered property editors types in {@link sap.ui.integration.designtime.baseEditor.BaseEditor BaseEditor configuration} (see <code>propertyEditors</code> section)</li> <li><b>path</b> = a binding path to get data from</li> </ul>

